import { createApp } from 'vue'
import App from './App.vue'
import './global.css'
import '@fortawesome/fontawesome-free/css/all.css';
import '@mdi/font/css/materialdesignicons.css';

Vue.use(Vuetify);

const vuetify = new Vuetify();

new Vue({
  vuetify,
}).$mount('#app');
